import Login from './pages/Login';
import Signup from './pages/Signup';
import Contact from './pages/Contact'
import { BrowserRouter, Route } from 'react-router-dom'; // Import BrowserRouter, Routes, and Route

function App() {
  return (
      <>
      <Route>
        <React path ="/" element ={<Home/>}/>
        <React path ="/Contact" element ={<Contact/>}/>
        <React path ="/Login" element ={<Login/>}/>
        <React path ="/Signup" element ={<Signup/>}/>
        <React path ="/Donate" element ={<Donate/>}/>
      </Route>
      </>
  );
}
